import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <section id="/" className="home-container">
      <header className="homepage-header">
        <h1>Welcome to the Planets and Species Explorer!</h1>
        <p>Explore the vast universe of planets and ancient species</p>
      </header>

      <section className="featured-section">
        <h2>Featured Content</h2>
        <div className="featured-content">
          <div className="featured-item">
            <img src="path_to_featured_image.jpg" alt="Featured Item" />
            <p>Description or information about the featured content</p>
          </div>
        </div>
      </section>
    </section>
  );
};

export default Home;
